import React, { useEffect, useState } from "react";
import { useNavigate } from "react-router-dom";
import { useAuth } from "../context/AuthContext";
import { roomService } from "../services/api";

const Dashboard = () => {
  const { user, logout } = useAuth();
  const navigate = useNavigate();
  const [rooms, setRooms] = useState([]);
  const [loading, setLoading] = useState(true);
  const [error, setError] = useState("");

  useEffect(() => {
    const fetchRooms = async () => {
      try {
        const res = await roomService.getUserRooms();
        setRooms(res.data.rooms);
      } catch (err) {
        setError("Failed to load rooms.");
      } finally {
        setLoading(false);
      }
    };
    fetchRooms();
  }, []);

  const handleCreateRoom = async () => {
    const roomName = prompt("Enter room name:");
    if (!roomName) return;
    try {
      const res = await roomService.createRoom({ roomName });
      navigate(`/room/${res.data.room.roomId}`);
    } catch (err) {
      alert(err.response?.data?.message || "Failed to create room.");
    }
  };

  const handleJoinRoom = async () => {
    const roomId = prompt("Enter room ID:");
    if (!roomId) return;
    try {
      const res = await roomService.joinRoom({ roomId });
      navigate(`/room/${roomId}`);
    } catch (err) {
      alert(err.response?.data?.message || "Failed to join room.");
    }
  };

  return (
    <div className="dashboard">
      <div className="dashboard-header">
        <h1>CollabBoard Dashboard</h1>
        <div className="user-info">
          <div className="user-avatar" onClick={() => navigate("/profile")} style={{ cursor: "pointer" }}>{user?.name?.[0]}</div>
          <span onClick={() => navigate("/profile")} style={{ cursor: "pointer" }}>{user?.name}</span>
          <button className="btn btn-secondary btn-sm" onClick={logout}>Logout</button>
        </div>
      </div>

      <div className="dashboard-actions">
        <div className="action-card" onClick={handleCreateRoom}>
          <span className="icon">üìù</span>
          <h2>Create Room</h2>
          <p>Start a new collaborative whiteboard session</p>
          <button className="btn btn-primary btn-sm">Create</button>
        </div>
        <div className="action-card" onClick={handleJoinRoom}>
          <span className="icon">üîó</span>
          <h2>Join Room</h2>
          <p>Enter a room ID to join an existing session</p>
          <button className="btn btn-primary btn-sm">Join</button>
        </div>
      </div>

      <div className="rooms-section">
        <h2>Your Rooms</h2>
        {loading ? (
          <div className="loading-container"><span className="spinner" /></div>
        ) : rooms.length === 0 ? (
          <div className="empty-state">
            <span className="empty-icon">üì≠</span>
            <p>No rooms found. Create or join a room to get started.</p>
          </div>
        ) : (
          <div className="rooms-grid">
            {rooms.map((room) => (
              <div
                className="room-card"
                key={room.roomId}
                onClick={() => navigate(`/room/${room.roomId}`)}
              >
                <div className="room-name">{room.roomName}</div>
                <div className="room-id">ID: {room.roomId}</div>
                <div className="room-meta">
                  <span>Host: {room.host?.name || "-"}</span>
                  <span>{room.participants.length} Participants</span>
                </div>
              </div>
            ))}
          </div>
        )}
      </div>
    </div>
  );
};

export default Dashboard;
